import BTCPrice from '../components/BTCPrice';
import InputField from '../components/inputField';
import LoginButton from '../components/LoginButton';
import LogoutButton from '../components/LogoutButton';
import Profile from '../components/Profile';
import PurchaseButton from '../components/PurchaseButton';
import { useAuth0 } from "@auth0/auth0-react";
import '../App.css';


import { useState } from 'react'
import { Dialog } from '@headlessui/react'
import { Bars3Icon, XMarkIcon } from '@heroicons/react/24/outline'

const navigation = [
    { name: 'Product', href: '#' },
    { name: 'Features', href: '#' },
    { name: 'Marketplace', href: '#' },
    { name: 'Company', href: '#' },
  ]

  export default function Home() {
    const [mobileMenuOpen, setMobileMenuOpen] = useState(false)

    return (
      <body>
        <div className="fixed bg-slate-400 h-screen w-screen top-0 left-0 -z-50">
          <div className="relative isolate overflow-hidden bg-gray-100 h-screen">
          <img
          src="books.png"
          alt=""
          className="absolute inset-0 -z-10 h-full w-full object-cover object-right md:object-center"
          />
        </div>
      </div>
        <header className="inset-x-0 top-0 z-50">
            <nav className="flex p-6 lg:px-8" aria-label="Global">
            < div className="flex-0">
                <a href="#" className="text-sm font-semibold leading-6 text-gray-900">
                  <LoginButton/>
                </a>
              </div>
              <div className="flex-1 flex flex-row lg:gap-x-12 justify-center">
                {navigation.map((item) => (
                  <a key={item.name} href={item.href} className="text-sm font-semibold leading-6 text-gray-900">
                    {item.name}
                  </a>
                ))}
              </div>
              <div className="flex-0">
                <a href="#" className="text-sm font-semibold leading-6 text-gray-900">
                  <LoginButton/>
                </a>
              </div>
              </nav>
          </header>
      </body>


    )
  }
